firstParagraph:"Grupa CANAL+, jej spółki zależne (w tym CANAL+ Polska S.A. i członkowie %vivendiGroup%) oraz nasi %partners% używają plików cookies i podobnych technologii do zarządzania usługami i ich ulepszania oraz oferowania bardziej dopasowanych reklam.",secondParagraph:"Możesz skonfigurować wybrane opcje według celu i zaktualizować je w dowolnym momencie w zakładce %confidentiality%.",thirdParagraph:"Jeśli jesteś zalogowany do swojego konta CANAL+, Twój wybór będzie dotyczył użytkowania i nawigacji aplikacji CANAL+ na każdym urządzeniu, z którego korzystasz.",thirdParagraphUnlog:"Twój wybór będzie ważny tylko na bieżącym urządzeniu. Jeśli zalogujesz się na swoje konto CANAL+, Twoje wybory wyrażone w trybie zalogowania będą miały pierwszeństwo.",learnMore:"Dowiedz się więcej i skonfiguruj moje opcje",OLD_firstCategoryTitle:"Pliki cookies obowiązkowe dla poprawnego działania usługi.",firstCategoryTitle:"Działanie usługi (wymagane)",OLD_firstCategoryText:"Sesyjne pliki cookies Użytkownika, weryfikacyjne, uwierzytelniające, bezpieczeństwa oraz identyfikacyjne są konieczne dla poprawnego działania Serwisu CANAL+.",firstCategoryText:"Identyfikatory te zapewniają działanie usługi, umożliwiając uwierzytelnianie użytkowników, bezpieczeństwo oraz (anonimowy) nadzór techniczny nad usługą. Nie można wyłączać tego ustawienia.",OLD_secondCategoryTitle:"Mierzenie oglądalności",secondCategoryTitle:"Analiza wydajności",OLD_secondCategoryText:"Statystyczne pliki cookies umożliwiają tworzenie anonimowych, zagregowanych statystyk w celu ulepszenia struktury i zawartości Serwisu CANAL+.",secondCategoryText:"Identyfikatory te umożliwiają mierzenie wykorzystania oraz wydajności naszych usług (z wyłączeniem anonimowego pomiaru oglądalności) w celu lepszego dostosowania się do Twoich oczekiwań.",OLD_thirdCategoryTitle:"Reklama",thirdCategoryTitle:"Spersonalizowana reklama",OLD_thirdCategoryText:"Reklamowe pliki cookies pozwalają Partnerom na wyświetlanie reklam dostosowanych do Twoich zainteresowań. Wyłączenie tych plików cookies nie będzie miało wpływu na liczbę wyświetlanych reklam, ale na ich trafność.",thirdCategoryText:"Reklamowe pliki cookie pozwalają nam, wraz z naszymi partnerami reklamowymi, oferować Ci reklamy dostosowane do Twoich zainteresowań, w oparciu o Twoje przeglądanie i profil oraz mierzyć ich oglądalność / skuteczność. Wyłączenie tych plików cookie nie będzie miało wpływu na liczbę reklam, a jedynie na ich trafność.",thirdCategoryText1:"Te identyfikatory pozwalają nam oraz naszym partnerom oferować reklamy dostosowane do Twoich zainteresowań. Dokładniej oznacza to, że będziemy mogli:",thirdCategoryItem1:"dostosowywać treści reklamowe do nawigacji realizowanej w Twoim terminalu lub do danych osobowych, które podałeś(-aś) w szczególności poprzez wykorzystanie funkcji targetowania reklam lub kontaktów e-mailowych na podstawie historii Twojego korzystania z naszych usług;",thirdCategoryItem2:"monitorować kolejne nawigacje wykonywane przez Twój terminal;",thirdCategoryItem3:"dostosowywać obszary reklamowe do preferencji wyświetleń na Twoim terminalu;",thirdCategoryItem4:"dostosowywać prezentację serwisu, z którym powiązane są treści reklamowe;",thirdCategoryItem5:"ograniczyć liczbę wyświetlanych reklam;",thirdCategoryItem6:"obliczać kwoty należne podmiotom w łańcuchu dystrybucji reklam;",thirdCategoryItem7:"mierzyć skuteczność i wpływ kampanii reklamowych.",thirdCategoryText2:"Wyłączając te identyfikatory, nie będziesz otrzymywać mniejszej ilości materiałów reklamowych, ale będą pojawiały się reklamy nie zawsze odpowiadające Twoim zainteresowaniom.",vendorListButton:"Lista partnerów",vendorTableTitle:"Firma",cookiePolicyLabel:"Zobacz naszą politykę plików cookies",declineButton:"Odrzuć wszystko",refuseButton:"Odrzuć wszystko",acceptButton:"Akceptuj wszystko",saveAndCloseButton:"Zapisz i zamknij",partners:"partnerzy",services:"lista usług",confidentiality:"Ustawienia plików cookies",cookiePolicy:"naszej polityki plików cookie",vive